/// <summary>
/// Overrides the standard update method to ensure that data caches are flushed.
/// </summary>
public void update()
{
    // <GEERU>
    #ISOCountryRegionCodes

    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]) &&
        this.orig().InventSumDateFinancialDimensionFocus_RU != this.InventSumDateFinancialDimensionFocus_RU)
    {
        InventSumDateFinancialCalc_RU::deleteAllData();
    }
    // </GEERU>
    super();
    flush InventParameters;
}

public boolean validateField(FieldId _fieldIdToCheck)
{
    boolean ret;
    // <GEERU>
    int maxDimSetSize, selDimSetSize;
    #ISOCountryRegionCodes
    // </GEERU>

    ret = super(_fieldIdToCheck);

    if (ret)
    {
        switch (_fieldIdToCheck)
        {
            case fieldNum(InventParameters, CostBreakdown):
                if (this.orig().CostBreakdown != this.CostBreakdown && FormDataUtil::isFormDataSource(this))
                {
                    if (Box::okCancel("@SYS121703", DialogButton::Cancel) == DialogButton::Ok)
                    {
                        ret = true;
                    }
                    else
                    {
                        ret = false;
                    }
                }
                break;
            // <GEERU>
            case fieldNum(InventParameters, SiteDimensionAttribute):
                if (this.SiteDimensionAttribute &&
                    SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]) &&
                    this.SiteDimensionAttribute == AgreementHeaderExt_RU::getAgreementDimensionAttribute())
                {
                    ret = checkFailed(strFmt("@GLS221828", DimensionAttribute::find(this.SiteDimensionAttribute).Name));
                }

                if (this.SiteDimensionAttribute != this.orig().SiteDimensionAttribute && !this.allowEditMultiSiteDimension())
                {
                    ret = checkFailed(strFmt("@CostManagement:MessageValidation_SiteDimensionNameNotEditable", fieldPName(InventParameters, SiteDimensionAttribute)));
                }
                break;
            case fieldNum(InventParameters, InventSumDateFinancialDimensionFocus_RU):
                if (ret && this.InventSumDateFinancialDimensionFocus_RU)
                {
                    if (DimensionHierarchyLevel::findByDimensionHierarchyAndDimAttribute(this.InventSumDateFinancialDimensionFocus_RU, DimensionAttribute::getWellKnownDimensionAttribute(DimensionAttributeType::MainAccount)))
                    {
                        ret = checkFailed(strFmt("@GLS223655", DimensionHierarchy::find(this.InventSumDateFinancialDimensionFocus_RU).Name));
                    }

                    maxDimSetSize  = new DictType(extendedTypeNum(FinancialDim_RU)).arraySize();
                    selDimSetSize = DimensionHierarchy::getLevelCount(this.InventSumDateFinancialDimensionFocus_RU);

                    if (selDimSetSize > maxDimSetSize)
                    {
                        ret = checkFailed(strFmt("@GLS223654", DimensionHierarchy::find(this.InventSumDateFinancialDimensionFocus_RU).Name, selDimSetSize, maxDimSetSize));
                    }
                }

                if (ret && this.orig().InventSumDateFinancialDimensionFocus_RU != this.InventSumDateFinancialDimensionFocus_RU)
                {
                    ret = Box::yesNo("@GLS223656", DialogButton::No) == DialogButton::Yes;
                }
                break;
            // </GEERU>
            // <GCN>
            case fieldNum(InventParameters, EnableLedgerAcctSites):
                if (!this.EnableLedgerAcctSites
                    && InventPosting::siteCodeUsed_CN(InventSiteCode_CN::Table))
                {
                    // There are lines with site relations as site ID, please remove them and try again.
                    ret = checkFailed("@GLS63304");
                }
                break;
            // </GCN>

            case fieldNum(InventParameters, InventUpdateOnHandInventSumLogTTsTmpTableThreshold):
                if (this.InventUpdateOnHandInventSumLogTTsTmpTableThreshold > InventUpdateOnhand::MaxInventUpdateOnHandInventSumLogTTsTmpTableThreshold)
                {
                    ret = checkFailed(strFmt("@SCM:InventParameters_FldInventUpdateOnHandInventSumLogTTsTmpTableThreshold_Validation", InventUpdateOnhand::MaxInventUpdateOnHandInventSumLogTTsTmpTableThreshold));
                }
                break;
        }
    }

    return ret;
}

