/// <summary>
/// Finds a record in the <c>InventParameters</c> table.
/// </summary>
/// <param name="_forupdate">
/// true if the record must be selected for update; otherwise, false.
/// </param>
/// <returns>
/// An <c>InventParameters</c> record.
/// </returns>
public static InventParameters find(boolean _forupdate = false)
{
    InventParameters parameter = InventParameters::findOrCreate(_forupdate);

    if (!parameter.ProductVariantFeaturesReady && !parameter.isTmp())
    {
        if (InventDistinctProductPopulatorInventItemOrderSetupUpgradeFlight::instance().isEnabled())
        {
            // Not setting ProductVariantFeaturesReady flag to true explicitly here as InventDistinctProductPopulator
            // is used, which is known to set this flag after first time initialization
            InventParameters::prepareProductVariantFeatures();
            parameter.reread();
        }
        else
        {
            ttsbegin;
            select pessimisticlock firstonly parameter
               where parameter.Key == 0;
            if (!parameter.ProductVariantFeaturesReady)
            {
                parameter.ProductVariantFeaturesReady = true;
                parameter.update();

                InventParameters::prepareProductVariantFeatures();

            }
            ttscommit;
        }
    }
    return parameter;
}

internal static InventParameters findOrCreate(boolean _forupdate = false)
{
    InventParameters parameter;

    if (_forupdate)
    {
        parameter.selectForUpdate(_forupdate);
    }

    select firstonly parameter
        index Key
        where parameter.Key == 0;

    if (!parameter && !parameter.isTmp())
    {
        Company::createParameter(parameter);
        PrintMgmt::createDefaultData(PrintMgmtHierarchyType::Invent);
    }

    return parameter;
}

/// <summary>
/// Enables and prepares the product variant features such as <c>InventDistinctProduct</c>.
/// </summary>
protected static void prepareProductVariantFeatures()
{
    // Populates the <c>InventDistinctProduct</c> table
    InventDistinctProduct::populateTable();

    if (!InventDistinctProductPopulatorInventItemOrderSetupUpgradeFlight::instance().isEnabled())
    {
        // Upgrades the data for <c>InventItemSetupXXX</c> classes for enabling default order settings per variant.
        InventItemOrderSetupUpgrade::upgradeData();
    }
}

